pragma solidity 0.5.16;
pragma experimental ABIEncoderV2;

contract Rating {
    struct item {
        uint256 likes;
        uint256 dislikes;
    }
    mapping(string => item) public itemsInformation;
    mapping(string => bool) public items;
    string[] public ratedItems;
    mapping(string => mapping(string => bool)) public ratingInformation;
    mapping(string => mapping(string => bool)) public voterToResource;

    /* Events */
    event LogSuccessfullyRatedItem(string message);
    event LogNoMultipleVotesAllowed(string errorMessage);

    function rateItem(
        string memory _credentials,
        string memory _resourceID,
        bool _vote
    ) public {
        if (voterToResource[_credentials][_resourceID] == true) {
            if (
                ratingInformation[_credentials][_resourceID] == true &&
                _vote == false
            ) {
                ratingInformation[_credentials][_resourceID] = false;
                itemsInformation[_resourceID].likes -= 1;
                itemsInformation[_resourceID].dislikes += 1;
            }
            if (
                ratingInformation[_credentials][_resourceID] == false &&
                _vote == true
            ) {
                ratingInformation[_credentials][_resourceID] = true;
                itemsInformation[_resourceID].likes += 1;
                itemsInformation[_resourceID].dislikes -= 1;
            }
        } else {
            if (items[_resourceID] == false) {
                items[_resourceID] = true;
                ratedItems.push(_resourceID);
                voterToResource[_credentials][_resourceID] = true;
                if (_vote == true) {
                    itemsInformation[_resourceID] = item(1, 0);
                    ratingInformation[_credentials][_resourceID] = true;
                    emit LogSuccessfullyRatedItem(
                        "Item was successfully rated."
                    );
                } else {
                    itemsInformation[_resourceID] = item(0, 1);
                    ratingInformation[_credentials][_resourceID] = false;
                    emit LogSuccessfullyRatedItem(
                        "Item was successfully rated."
                    );
                }
            } else {
                voterToResource[_credentials][_resourceID] = true;
                if (_vote == true) {
                    itemsInformation[_resourceID].likes += 1;
                    emit LogSuccessfullyRatedItem(
                        "Item was successfully rated."
                    );
                } else {
                    itemsInformation[_resourceID].dislikes += 1;
                    emit LogSuccessfullyRatedItem(
                        "Item was successfully rated."
                    );
                }
            }
        }
    }

    /* This function returns the number of likes/dislikes for a specific item */
    function getItemInformation(string memory _resourceID)
        public
        view
        returns (uint256, uint256)
    {
        return (
            itemsInformation[_resourceID].likes,
            itemsInformation[_resourceID].dislikes
        );
    }

    function getNumberOfRatedItems() public view returns (uint256) {
        return ratedItems.length;
    }

    function getRatedItem(uint256 _index) public view returns (string memory) {
        return ratedItems[_index];
    }

    function getRatedItems() public view returns (string[] memory) {
        return ratedItems;
    }
}
